import { Auth } from "../../API/Api";
import {  Status } from "../Type";

export const GetAuth = (data) => {

  return (dispatch)=>{

     Auth(dispatch,data)
  }
 
};


export const GetAuth1 = (data)=>{
  return {
    type: Status,
    payload: data
  };
}
